import React from "react";
import style from "./style.module.css";
import map from "../../images/map.png";
import instagram from "../../images/instagram.svg";
import whatssapp from "../../images/whatsapp.svg";

export const Footer = () => {
  return (
    <div className={style.footer}>
      <div className={style.visitcard}>
        <div className={style.visitcardContact}>
          <h3>Contact</h3>
          <p>+49 999 999 99 99</p>
          <div className={style.instagram}>
            <img src={instagram} alt="insta" />
            <h6>Instagram</h6>
          </div>
          <div className={style.whatsapp}>
            <img src={whatssapp} alt="WhatsApp" />
            <h6>WhatsApp</h6>
          </div>
        </div>
        <div className={style.visitcardAdress}>
          <h3>Address</h3>
          <p>Linkstra√üe 2, 8 OG, 10785, Berlin, Deutschland</p>
          <div className={style.instagram}>
            <img src={instagram} alt="insta" />
            <h6>Instagram</h6>
          </div>
          
        </div>
      </div>
      <div className={style.map}>
        <img src={map} alt="map" />
      </div>
    </div>
  );
};
